//就要这张券--------------------------------------------------------------------------------------------------------------------------
$('.js_sure_b').on('click',function(){
  var data = {};
  data.openid = $('#openid').val();
  data.syssn = $('#syssn').val();
  data.userid = $('#userid').val();
  data.amt = $('.js_price').text();
  $.ajax({
    url: location.pathname,
    type: 'post',
    dataType: 'json',
    data: data,
    beforeSend: function(){
        $('#loading').show();
        $('.zheceng').show();
    },
    success: function(data) {
        $('#loading').hide();
        $('.zheceng').hide();
        if (data.respcd != '0000') {
            $('.alert_con').show();
            if(!data['respmsg']){
              $('.alert_con .alert_con_br').html(data['resperr']);
            }else{
              $('.alert_con .alert_con_br').html(data['respmsg']);
            }                   
            $('.zheceng').show();
           // WeixinJSBridge.invoke('closeWindow',{},function(res){});
        } else {
            $('.js_price').text(data.price);
        }
    },
    error:function(data) {
        $('#loading').hide();
        $('.alert_con').show();                 
        $('.zheceng').show();
        if(!data['respmsg']){
            $('.alert_con .alert_con_br').html(data['resperr']);
        }else{
            $('.alert_con .alert_con_br').html(data['respmsg']);
        }
       // WeixinJSBridge.invoke('closeWindow',{},function(res){});
    },
    complete: function(){
        // $('#loading').hide();
        // $('.zheceng').hide();
    }
  });
});
