//刮刮卡-------------------------------------------------------------------------------------------------------------------------------
var c1; //画布
var myCanvas;
var gray;
var ctx; //画笔
var ismousedown; //标志用户是否按下鼠标或开始触摸
var isOk=0; //标志用户是否已经刮开了一半以上
var fontem = parseInt(window.getComputedStyle(document.documentElement, null)["font-size"]);//这是为了不同分辨率上配合@media自动调节刮的宽度
//刮刮卡--图片--------------------------------------------------------------------------------
//页面加载后开始初始化画布（这样子就可以在页面创建一个画布了）
window.onload = function(){ 
    $('.js_price').text('3.8');
    myCanvas = document.getElementById('myCanvas');
    myCanvas.width=myCanvas.clientWidth;
    myCanvas.height=myCanvas.clientHeight;
    var can_width=myCanvas.clientWidth;
    var can_height=myCanvas.clientHeight;
    gray = myCanvas.getContext('2d');
    console.log(gray);
    gray.beginPath();
    gray.fillStyle = "#ffe8cc";
    gray.fillRect(0,0,can_width,can_height); 
    var image = new Image();
    //image.src = "img/crash_gua.png";
    //image.src = "data:image/png;base64,";  
    image.src='data:image/png;base64,';
    image.onload = function () {
        //把这个属性设为这个就可以做出圆形橡皮擦的效果
        //有些老的手机自带浏览器不支持destination-out,下面的代码中有修复的方法 
        gray.drawImage(image,0,0,can_width,can_height);    
        gray.globalCompositeOperation = 'destination-out';
    } 
    gray.closePath();
    //PC端的处理
    myCanvas.addEventListener("mousemove",eventMove1,false);
    myCanvas.addEventListener("mousedown",eventDown,false);
    myCanvas.addEventListener("mouseup",eventUp1,false);
    //移动端的处理
    myCanvas.addEventListener('touchstart', eventDown,false);
    myCanvas.addEventListener('touchend', eventUp1,false);
    myCanvas.addEventListener('touchmove', eventMove1,false);
} 

//就要这张券是否显示
function if_this_crash(){
    if($('.js_price').text().length==0){
        return false;
    }
    $('.js_gua_button').show();
    var this_crash=$('#coupon_batch_id').val();
    if(this_crash==6){
        $('.js_sure_b').hide();
        $('.js_more_b').addClass('wid_100');
    }else{
        $('.js_sure_b').show();
        $('.js_more_b').removeClass('wid_100');
    }
    var hhh=$('body').height();
    window.scrollTo(0,hhh);
}
//刮刮卡事件-----------------------------------------------------------------------------------------------------------------------------
//bodytouch
function bodytouch(e){
    e.preventDefault();
} 
//鼠标按下 和 触摸开始
function eventDown(e){
    e.preventDefault();
    ismousedown=true;
    //$('.js_price').css('color','#2f323a');
    //控制奖项的显示，避免在遮层图片没有显示完成的时候暴露奖项
    $('.js_quanshow').show();
    document.body.addEventListener('touchmove', bodytouch, false);
}
//鼠标抬起 和 触摸结束
function eventUp1(e){
    e.preventDefault();
    //得到canvas的全部数据
    var a = gray.getImageData(0,0,myCanvas.width,myCanvas.height);
    // console.log(a.data);
    // console.log(a.data.length);
    var j=0;
    for(var i=3;i<a.data.length;i+=4){
        if(a.data[i]==0)j++;
    }
    //当被刮开的区域等于一半时，则可以开始处理结果
    if(j>=a.data.length/8){
        isOk = 1;
        //console.log(j);
        if_this_crash();
        $('#myCanvas').hide();
        //alert();
    }
    ismousedown=false;
    document.body.removeEventListener('touchmove', bodytouch, false);
}
//鼠标移动 和 触摸移动
function eventMove1(e){
            //console.log(e); 
     e.preventDefault();
     if(ismousedown) {
            if(e.changedTouches){
                e=e.changedTouches[e.changedTouches.length-1];
            }
            var topY = document.getElementById("guaguaka").offsetTop;
            var topX = document.getElementById("guaguaka").offsetLeft;
            var oX = myCanvas.offsetLeft+topX,
            oY = myCanvas.offsetTop+topY;
            var x = (e.clientX + document.body.scrollLeft || e.pageX) - oX || 0,
                y = (e.clientY + document.body.scrollTop || e.pageY) - oY || 0; 
            //gray.clearRect(x, y, 60,60);
            //gray.clearRect(e.clientX, e.clientY, 60,60);

         //画360度的弧线，就是一个圆，因为设置了ctx.globalCompositeOperation = 'destination-out';
         //画出来是透明的
         gray.beginPath();
         gray.arc(x, y, fontem*1.2, 0, Math.PI * 2,true);

         //下面3行代码是为了修复部分手机浏览器不支持destination-out
         myCanvas.style.display = 'none';
         myCanvas.offsetHeight;
         myCanvas.style.display = 'inherit'; 
         gray.fill();
     }
     if(isOk){    
        
     }
}
